import React, { useState } from "react";
import UploadCV from "./components/UploadCV";
import { checkATS, matchJD } from "./api";
import "./App.css"; // We'll use a separate CSS file

export default function App() {
  const [cvData, setCvData] = useState(null);
  const [atsScore, setAtsScore] = useState(null);
  const [jdScore, setJdScore] = useState(null);
  const [jobDescription, setJobDescription] = useState("");

  const handleATS = async () => {
    try {
      const res = await checkATS();
      setAtsScore(res.data.score);
    } catch (err) {
      alert("ATS check failed. Make sure backend is running.");
      console.error(err);
    }
  };

  const handleJDMatch = async () => {
    if (!jobDescription) return alert("Enter job description first.");
    try {
      const res = await matchJD(jobDescription);
      setJdScore(res.data.matchScore);
    } catch (err) {
      alert("JD match failed.");
      console.error(err);
    }
  };

  return (
    <div className="container">
      <h1 className="title">CV ATS System</h1>

      <UploadCV setData={setCvData} />

      {cvData && (
        <div className="cv-card">
          <h2 className="section-title">Extracted CV Data</h2>

          <div className="info-row">
            <p><strong>Name:</strong> {cvData.name || "N/A"}</p>
            <p><strong>Email:</strong> {cvData.email || "N/A"}</p>
            <p><strong>Phone:</strong> {cvData.phone || "N/A"}</p>
          </div>

          <div className="section">
            <h3>Education</h3>
            {cvData.education?.length > 0 ? (
              <ul>{cvData.education.map((edu, i) => <li key={i}>{edu}</li>)}</ul>
            ) : <p>N/A</p>}
          </div>

          <div className="section">
            <h3>Experience</h3>
            {cvData.experience?.length > 0 ? (
              <ul>{cvData.experience.map((exp, i) => <li key={i}>{exp}</li>)}</ul>
            ) : <p>N/A</p>}
          </div>

          <div className="section">
            <h3>Projects</h3>
            {cvData.projects?.length > 0 ? (
              <ul>{cvData.projects.map((proj, i) => <li key={i}>{proj}</li>)}</ul>
            ) : <p>N/A</p>}
          </div>

          <h3>Skills</h3>
<ul>{cvData.skills?.map((skill, i) => <li key={i}>{skill}</li>)}</ul>

<h3>Certifications</h3>
<ul>{cvData.certifications?.map((cert, i) => <li key={i}>{cert}</li>)}</ul>


          <div className="ats-section">
            <button className="btn" onClick={handleATS}>Check ATS Score</button>
            {atsScore && <p className="score">ATS Score: {atsScore}/100</p>}
          </div>

          <div className="jd-section">
            <textarea
              rows="4"
              placeholder="Paste Job Description here..."
              value={jobDescription}
              onChange={(e) => setJobDescription(e.target.value)}
            />
            <button className="btn" onClick={handleJDMatch}>Match Job Description</button>
            {jdScore && <p className="score">JD Match Score: {jdScore}%</p>}
          </div>
        </div>
      )}
    </div>
  );
}
